import React from "react";
import Navbar from "./Navbar.jsx";
import "./Postdetails.css";
import { Link } from "react-router-dom";

class Postdetails extends React.Component {


    render() {
      return (
        //NavBar
        <div id="row wholepage" className="wholepage">
            <div className="row Createpost">
        <header className="col-12 Home-Header">
          <Navbar/> 
        </header>
            </div>
            <div id="row wholeform" className="col-12 wholeform">    
            <h3><center>Post Detail</center></h3>                         
            </div>
            <div id="row col-12 wholeform" className="wholeform"> 
                <form>
                        <textarea type="text" placeholder = "Your Comment" id="row text2" className="text2"/>
                        <Link to = '/Homepage'><button type="button" onClick={this.onSubmit} className="btn">Post Comment</button></Link>
                </form>               
            </div>   
        </div>
      );
    }
  }
  export default Postdetails;
